void draw_lines(float*buf,int n)
{
  int i;
  glBegin(GL_LINES);
  for(i=0;i<n;i++)
    glVertex2fv(buf+2*i);
  glEnd();
}
void draw_digit(int digit)
{
  switch(digit){
    case 0: draw_lines(char_zero,len(char_zero)/2); break;
    case 1: draw_lines(char_one,len(char_one)/2); break;
    case 2: draw_lines(char_two,len(char_two)/2); break;
    case 3: draw_lines(char_three,len(char_three)/2); break;
    case 4: draw_lines(char_four,len(char_four)/2); break;
    case 5: draw_lines(char_five,len(char_five)/2); break;
    case 6: draw_lines(char_six,len(char_six)/2); break;
    case 7: draw_lines(char_seven,len(char_seven)/2); break;
    case 8: draw_lines(char_eight,len(char_eight)/2); break;
    case 9: draw_lines(char_nine,len(char_nine)/2); break;
  }
}
void draw_number(int number)
{
  int i;
  char s[200];
  snprintf(s,200,"%d",number);
  glPushMatrix();
  glTranslated(350,100,0);
  glScaled(3,3,3);
  glRotated(90,0,0,1);
  for(i=0;i<strlen(s);i++){
    glTranslated(0,11,0);
    draw_digit(s[i]-48);
  }
  glPopMatrix();
}
